import SidebarMenu from 'react-bootstrap-sidebar-menu';
import { Outlet, Link } from "react-router-dom";

export default function StudentSideBar(){
    return(
    <>
    <SidebarMenu>
        <SidebarMenu.Header>
            <SidebarMenu.Toggle />
        </SidebarMenu.Header>
        <SidebarMenu.Body>
            <SidebarMenu.Nav>
                <SidebarMenu.Nav.Link>
                <SidebarMenu.Nav.Title>
                {"Reports"}
                </SidebarMenu.Nav.Title>
                </SidebarMenu.Nav.Link>
            </SidebarMenu.Nav>
        </SidebarMenu.Body>
    </SidebarMenu>

    <Outlet/>
    </>
    );
}
